import React from 'react';
import { Link } from 'react-router-dom';
import './header.css';

const Header = () => {
    return (
        <div className="header">
            <Link to={'/'} >RE-Store</Link>
            <Link to={"/content/"}>Content</Link>
        </div>
        
    );
}

export default Header;
